import './App.css';

export default () => {
  const data = [
    { ID: 1, title: '浙江', opened: 'closed', onSelect: 'selected' },
    { ID: 2, title: '江苏', opened: 'closed', onSelect: 'selected' },
    { ID: 3, title: '福建', opened: 'closed', onSelect: 'selected' },
  ];
  return(
    <ul className='tree'>
      <li className='tree-item'>
        <div className='tree-title'>
          <div className='folder open'></div>
          <div className='checkbox'></div>
          <div className='item'></div>

        </div>

      </li>

    </ul>
  )
}
